import Link from "next/link";
import React from "react";

class Card extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    const {
      name,
      imgsrc,
      imgalt,
      title,
      strbody,
      btncaption,
    } = this.props.cardInfo;
    return (
      <div className="card border-0">
        <div className="card-header mb-3 text">{name}</div>
        <img className="card-img-top w-50 mx-auto" src={imgsrc} alt={imgalt} />
        <div className="card-body">
          <h5 className="card-title">{title}</h5>
          <p className="card-text">{strbody}</p>
          <Link href="/contact">
            <a className="btn btn-outline-primary btn-block">{btncaption}</a>
          </Link>
        </div>
      </div>
    );
  }
}

export default Card;
